\":90,\"reply_count\":5,\"like_count\":348,\"quote_count\":9},\"created_at\":\"2021-05-31T21:25:31.000Z\",\"lang\":\"en\",\"text\":\"Most employers don’t give a fuck about their employees mental health.\",\"id\":\"1399477164702015488\"},{\"author_id\":\"250858058\",\"possibly_sensitive\":false,\"conversation_id\":\"1399437159862521859\",\"source\":\"Twitter for iPhone\",\"public_metrics\":{\"retweet_count\":188,\"reply_count\":13,\"like_count\":764,\"quote_count\":8},\"created_at\":\"2021-05-31T18:46:33.000Z\",\"lang\":\"en\",\"text\":\"I often find myself doubting my own testimony if I don’t back it up with international organizations and representatives. I even amplified anti-apartheid Jewish voices and Israeli voices because we’ve been so invalidated. I am still un-learning that our own testimonies are enough\",\"id\":\"1399437159862521859\"},{\"entities\":{\"hashtags\":[{\"start\":60,\"end\":66,\"tag\":\"ica21\"},{\"start\":148,\"end\":153,\"tag\":\"jace\"}],\"mentions\":[{\"start\":10,\"end\":17,\"username\":\"mjdutt\"},{\"start\":100,\"end\":114,\"username\":\"EthnicityRace\"},{\"start\":126,\"end\":137,\"username\":\"wunpini_fm\"},{\"start\":138,\"end\":147,\"username\":\"JordaanS\"}],\"urls\":[{\"start\":154,\"end\":177,\"url\":\"https://t.co/xIKDm48Bhb\",\"expanded_url\":\"https://twitter.com/miriamhdz/status/1399427272784846849/photo/1\",\"display_url\":\"pic.twitter.com/xIKDm48Bhb\"},{\"start\":178,\"end\":201,\"url\":\"https://t.co/jAFIZeQb6h\",\"expanded_url\":\"https://twitter.com/icahdq/status/1399380542798303232\",\"display_url\":\"twitter.com/icahdq/status/…\"}],\"annotations\":[{\"start\":25,\"end\":54,\"probability\":0.6572,\"type\":\"Other\",\"normalized_text\":\"Aubrey Fisher Mentorship Award\"}]},\"author_id\":\"46713815\",\"possibly_sensitive\":false,\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1399380542798303232\"}],\"conversation_id\":\"1399427272784846849\",\"source\":\"Twitter Web App\",\"public_metrics\":{\"retweet_count\":3,\"re